// src/Header.tsx

import React from 'react';
import './NavBar.css';

const NavBar: React.FC = () => {
  return (
    <header className="header">
      <div className="header__logo">
        <img src="/logo.png" alt="Logo" />
      </div>
      <button className="header__button">Login</button>
    </header>
  );
};

export default NavBar;
